public class City implements Comparable<City>{    private String name;    private int zipCode;    public City(int zipCode, String name) {        this.name = name;        this.zipCode = zipCode;    }    @Override    public String toString() {        return String.format("%s %s", this.zipCode, this.name);    }    @Override    public int compareTo(City o) {        return Integer.compare(this.zipCode, o.zipCode);    }    @Override    public boolean equals(Object o) {        if (this == o) return true;        if (o == null || getClass() != o.getClass()) return false;        City city = (City) o;        return zipCode == city.zipCode;    }    @Override    public int hashCode() {        return zipCode;    }    public String getName() {        return name;    }    public int getZipCode() {        return zipCode;    }}